  content: '';
  -webkit-box-shadow: 0 0 16px 2px rgba(0, 0, 0, 0.2);
          box-shadow: 0 0 16px 2px rgba(0, 0, 0, 0.2);
  border-radius: inherit;
  opacity: 0;
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: -1;
  -webkit-transition: opacity 0.5s cubic-bezier(0.165, 0.84, 0.44, 1);
