.tax-work_industry .title,
.tax-work_project_type .title {
  transform: translateY(11px);
}

.post-type-archive-work .site-header-bg,
.tax-work_industry .site-header-bg,
.tax-work_project_type .site-header-bg {
  opacity: 1.0;
  background: #1d252d;
}

.post-type-archive-work .filter-icon,
.tax-work_industry .filter-icon,
.tax-work_project_type .filter-icon {
  margin-right: -25px;
}

.work-filter {
  background-color: #999999;
}

.work-filter.is-active,
.work-filter:hover {
  background-color: rgba(70, 153, 201, 0.9);
}

.work-item.col-md-12.col-lg-12 .work-item-bg-wrapper {
  position: relative;
}

.work-item.col-md-12.col-lg-12 .work-item-bg {
  position: absolute;
  top: -100%;
  left: 0;
  right: 0;
  bottom: -100%;
  margin: auto;
}

.work-item {
  overflow: hidden;
  display: none;
  transition: all 0.1s ease-out;
}

.work-item .background-image {
  opacity: 0.0;
  transition: 0.2s ease-in;
}

.work-item .background-image.is-loaded {
  opacity: 1.0;
}

.work-item .work-item-bg {
  opacity: 0.05;
  transition: all 0.1s ease-out;
}

.work-item.is-currently-active {
  transition: all 0.1s ease-out;
  display: block;
}

.work-item * {
  transform: translateZ(0);
}

.work-item .work-item-bg-wrapper {
  overflow: hidden;
}

.work-item .work-item-cover {
  background-color: rgba(70, 153, 202, 0.8);
  opacity: 0.0;
  transition: all 0.3s ease-out;
}

.work-item .work-item-bg {
  background-size: cover;
  -webkit-transform: translate3d(0, 0, 0);
  transition: all 0.3s ease-out;
}

.work-item .work-item-caption {
  opacity: 0.0;
  transform: scale(1.2);
  transition: all 0.3s 0.15s ease-out;
}

.work-item:hover .work-item-cover,
.work-item:active .work-item-cover {
  opacity: 1.0;
}

.work-item:hover .work-item-bg,
.work-item:active .work-item-bg {
  transform: scale(1.2);
}

.work-item:hover .work-item-caption,
.work-item:active .work-item-caption {
  opacity: 1.0;
  transform: scale(1);
}

@media (max-width: 670px) {
  .work-item:hover .work-item-caption,
  .work-item:active .work-item-caption {
    transform: scale(0.85);
  }
}

.share-links {
  border-radius: 30px;
  max-width: 155px;
}

.share-links .share-link {
  width: 30px;
  height: 30px;
}

.work-cms-content .inner-wrap {
  transition: all 0.4s ease-out;
  opacity: 0.0;
}

.work-cms-content .inner-wrap.show {
  opacity: 1.0;
}

.work-cms-content .inner-wrap p {
  line-height: 1.5em;
  margin: 0 0 1.25em 0;
}

.work-cms-content .arrow-icon {
  background-image: url("../images/down-arrow.png");
  transition: 0.5s all;
  transform: rotate(180deg);
}

.work-cms-content.expanded .arrow-icon {
  transform: rotate(0);
}

.work-fader {
  height: 46px;
  width: 100%;
  position: relative;
}

.work-fader [data-js-word-item] {
  position: absolute;
  top: 0;
  left: 0;
  opacity: 0.0;
  transition: 0.2s ease-out;
}

.work-fader [data-js-word-item].active {
  opacity: 1.0;
}

@media (max-width: 1180px) {
  .work-fader {
    height: 30px;
  }
}

@media (max-width: 992px) {
  .work-fader {
    height: 50px;
  }
}

@media (max-width: 640px) {
  .work-fader {
    height: 30px;
  }
}

.metric-slide {
  opacity: 0.0;
  transition: 0.5s ease-in;
}

.metric-slide.active {
  opacity: 1.0;
}

@media (max-width: 640px) {
  .award-name {
    font-size: 22px;
  }
}

.single-work .award-slide {
  opacity: 0.0;
  transition: 0.5s ease-in;
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  left: 0;
  right: 0;
  margin: 0 auto;
  padding-left: 20px;
  padding-right: 20px;
}

.single-work .award-slide.active {
  opacity: 1.0;
}

.single-work .share-links {
  width: 45px;
  transition: width 0.1s ease-out;
  max-width: 100%;
}

.single-work .share-links .share-link {
  opacity: 0.0;
  pointer-events: none;
  transition: opacity 0.1s 0.1s ease-out;
}

.single-work .share-links .trigger {
  position: absolute;
  right: 8px;
}

.single-work .share-links.active {
  width: 185px;
}

.single-work .share-links.links-active .share-link {
  opacity: 1.0;
  pointer-events: auto;
  transition: opacity 0.1s ease-out;
